import React from "react";
import "./styles.css";

const Card = () => {
  return (
    <div className="card-container">
      <div className="card-head">
        <h1>Brand</h1>
        <p>$60.00</p>
      </div>
      <img />
      <div className="card-foot">
        <p>Vans Old School Love Me</p>
        <p>White</p>
      </div>
    </div>
  );
};

export default Card;
